        public const string CoachBiography1 = "Председател и основател на Бадминтон клуб „Ракет Спийд“ е Гергин Ангелов.\n\nТой е млад и енергичен спортист, с вече 15 годишен опит, като национален състезател по бадминтон на България. Двукратен републикански шампион през 2007 и 2010 год. на единично и многократен републикански шампион на двойки, както и шампион на множество държавни отборни първенства през годините. Успява да достигне до 8-мо място на европейско първенство за юноши във Финландия и до топ 200 в световната ранглиста на мъже единично. Гергин е дългогодишен състезател във вътрешните лиги на Германия, Италия, Дания (страната на бадминтона) и Норвегия. Успява да достигне финал в Италианската първа лига със своя отбор от северна Италия.  Той също така е с множество международни отличия, като състезател и представител на българския национален отбор в цяла Европа, с голям опит като треньор в Норвегия, Дания и България.";

