        public const string PostContent1 = "ВТОРО МЯСТО🥈за мъжкия отбор на Бадминтон клуб Ракет Спийд на Държавно отборно първенство за мъже и жени “А” група 2023 год.!\n\n🟥⬛ След изключително завързани мачове във финалния ден на първенството, нашият мъжки отбор успя да се пребори за второто място и беше на крачка от титлата на България!\n\n🟥⬛ Мъжкият отбор на БК Ракет Спийд в състав: Милан Дратва, Димитър Янакиев, Евгени Панев, Антон Далов и ръководител: Гергин Ангелов постигна исторически успех за клуба след като успя да завоюва титла за второ място в България с първото си участие в Държавно отборно първенство “А” група!🥈🏆🇧🇬\n🟥⬛ След общо изиграни 5 отборни мача на първенството и изключително тежки мачове, нашият отбор успя да постигне големият си успех благодарение на четирите победи които завоюва в груповите фази и във финалната четворка със следните отбори и резултати:\n\n29.04.2023 г. Група 2\n\nБК Ракет Спийд – БК Кърджали 4️⃣ : 1️⃣\nБК Ракет Спийд – БК Виас 3️⃣ : 2️⃣\n30.04.2023 г. ФИНАЛНА ЧЕТВОРКА\n\nБК Ракет Спийд – Виктори БК 2️⃣ : 3️⃣\nБК Ракет Спийд – БК Левски-Люлин 3️⃣ : 2️⃣\nБК Ракет Спийд – БК Стара Загора 4️⃣ : 1️⃣\n\n🏆🥈 Благодарности на всички състезатели от състава на мъжкия отбор на БК Ракет Спийд, които се бориха със сърце и душа и дадоха най-доброто си за отбора! Благодарности и на всички фенове на клуба, които подкрепяха мъжкия ни отбор през цялото първенство! Няма съмнение, че второто място ще ни мотивира още повече и догодина ще гоним титлата с още по-голяма сила и  амбиция!💪🟥⬛🏆🇧🇬";

