        public const string PostTitle2 = "Бадминтон клуб Ракет Спийд със собствена зала за бадминтон в с. Равно поле, Община Елин Пелин! Посетете ни!";
        public const string PostContent2 = "Днес се сбъдна една голяма мечта‼️ Бадминтон клуб Ракет Спийд със собствена зала за бадминтон в община Елин Пелин с. Равно поле! 🏆🏆🏆\n🟥⬛ Председателят и основател на Бадминтон клуб Ракет Спийд – Гергин Ангелов заедно с кмета на Община Елин Пелин г-н Ивайло Симеонов, зам.кмета г-жа Николова и кмета на с. Равно Поле г-н Григор Господинов откриха новата зала на клуба, която се намира в с. Равно Поле само на 20 км. от София и на 7 км от град Елин Пелин!\n\n🟥⬛ Топ състезателят на Бадминтон клуб Ракет Спийд, който е трикратен шампион на България за 2023 год. и топ 100 в световната ранглиста и първа ракета на България в националния отбор на мъже единично – Даниел Николов заедно с дългогодишния състезател Марин Маринов демонстрираха разигравания в бадминтона на високо ниво пред ръководството на Община Елин Пелин и показаха защо това е най-бързия спорт в света!\n\n🟥⬛ Бадминтон клуб Ракет Спийд има регистриран клон на клуба в Община Елин Пелин от 2022 год. и само за една година дейност повече от 40 деца са част от групата на клуба в Елин Пелин и имат редовен тренировъчен процес, медали от клубни и национални турнири и участие във всички държавни първенства през 2023 год. от държавния спортен календар във всички възрастови групи!\n\n🟥⬛ Благодарности на Община Елин Пелин и на г-н Ивайло Симеонов за огромната подкрепа и съдействие благодарение на които тази дългоочаквана мечта за нашия клуб се превърна в реалност!\n\n🟥⬛ Групата на клуба в Община Елин Пелин и залата в с. Равно поле са вече основен център на клуба, където ще се насочат всички усилия за привличане на нови бъдещи шампиони от с. Равно Поле община Елин Пелин, които един ден да бъдат на световно ниво като нашия голям шампион Даниел Николов!\n\n🟥⬛ Вярваме, че в близко бъдеще бадминтона ще се превърне в традиция за с. Равно поле, а новата собствена залата на клуба ще бъде дом на най-големите шампиони в страната!";

