        public const string PostContent3 = "🟥⬛ Държавния личен шампионат за младежи и девойки под 19 години се проведе на 17-19 Март в град Стара Загора!\n\nОт Бадминтон клуб Ракет Спийд взеха участие Антон Далов и Мария-Магдалена Василева. Двамата състезатели на клуба участваха във всички дисциплини на шампионата и направиха достойно класиране!\n\n🟥⬛Антон Далов завоюва бронзов медал и трето място 🥉на младежи двойки заедно с партньора си Виктор Радев от БК “Победа” Дупница ‼️\nНа единично Тончо загуби в първи кръг с три оспорвани гейма, а на смесени двойки на 1/8 финал и се класира на 9-16 място с партньорката си Мария-Магдалена Василева!\n\n🟥⬛ Мария-Магдалена Василева загуби на 1/4 финал девойки двойки с партньорката си Дарина Киселова от БК “Победа” Дупница и се класира на 5-8 място на двойки девойки!\n\nНа единично Маги загуби в първи кръг, а на смесени двойки на 1/8 финал и се класира на 9-16 място с партньора си Антон Далов!\n\n✅ Адмирации за нашите състезатели във възрастова група под 19 години ➡️ Антон Далов и Мария-Магдалена Василева за страхотното представяне, въпреки факта че за Маги това беше едва първо държавно първенство, а за Тони второ! Страхотен опит и за двамата ни младежи, а медала на Антон Далов 🥉е добър успех и показател че големите победи те първа предстоят! 💪";

